// ProductCatalogue.js
import React from 'react';

const products = [
  { id: 1, name: 'Calculator', price: 1000, category: ' Stationery', image: 'data:image/jpeg;base64,' },
  { id: 2, name: 'kurta', price: 599, category: 'Fashion', image: 'data:image/jpeg;base64,' },
  { id: 3, name: 'Lipstick', price: 299, category: 'Cosmetics', image: 'data:image/jpeg;base64,' },
  { id: 4, name: 'Perfume ', price: 300, category: ' Cosmetics', image: 'data:image/jpeg;base64,' },
  { id: 5, name: 'Watch', price: 1500, category: 'Fashion', image: 'data:image/jpeg;base64,' },
  { id: 6, name: 'Bean Bag', price: 1999, category: 'Furniture', image: 'data:image/jpeg;base64,' },
  { id: 7, name: 'Buddha', price: 399, category: 'Home Decor', image: 'data:image/jpeg;base64,' },
  { id: 8, name: 'Mobile', price: 150000, category: 'Appliances', image: 'data:image/jpeg;base64,' },
  { id: 9, name: 'Iodised Salt', price: 20, category: 'Groceries', image: 'data:image/jpeg;base64,' },
  { id: 10, name: 'Washing Machine', price: 30000, category: 'ElectronicAppliances', image: 'data:image/jpeg;base64,' },
  { id: 11, name: 'Buddha', price: 399, category: 'Home Decor', image: 'data:image/jpeg;base64,' },
  { id: 12, name: 'Food', price: 399, food: 'Home Decor', image: 'data:image/jpeg;base64,' },

  // Add more products as needed
];  

const ProductCatalogue = ({ addToCart, searchTerm }) => {
  const filteredProducts = searchTerm
    ? products.filter(product => product.category.toLowerCase().includes(searchTerm.toLowerCase()))
    : products;

  return (
    <div className="product-catalogue">
      <h2>Product Catalogue</h2>
      {filteredProducts.length === 0 ? (
        <p>No results found for "{searchTerm}"</p>
      ) : (
        filteredProducts.map((product) => (
          <div key={product.id} className="product-card">
            <img src={product.image} alt={product.name} />
            <h3>{product.name}</h3>
            <p>Category: {product.category}</p>
            <p>Price: ₹{product.price}</p>
            <button onClick={() => addToCart(product)}>Add to Cart</button>
          </div>
        ))
      )}
    </div>
  );
};

export default ProductCatalogue;